import React, { useState, useRef, useEffect } from 'react';

const PropertyListings = () => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const sliderRef = useRef(null);
  
  // Sample property data - replace with your actual data
  const properties = [
    {
      id: 1,
      title: "Modern Apartment",
      location: "123 Downtown Ave",
      price: "$1,200/month",
      image: "/api/placeholder/400/300",
      badge: "For Rent",
      beds: 2,
      baths: 1,
      area: "850 sq ft",
      agent: "John Smith",
      daysOnMarket: 5,
      priceChange: "+2.5%"
    },
    {
      id: 2,
      title: "Luxury Villa",
      location: "456 Beachfront Rd",
      price: "$2,500/month",
      image: "/api/placeholder/400/300",
      badge: "For Sale",
      beds: 4,
      baths: 3,
      area: "2400 sq ft",
      agent: "Sarah Johnson",
      daysOnMarket: 12,
      priceChange: "-1.5%"
    },
    {
      id: 3,
      title: "Cozy Studio",
      location: "789 City Center Blvd",
      price: "$850/month",
      image: "/api/placeholder/400/300",
      badge: "For Rent",
      beds: 1,
      baths: 1,
      area: "500 sq ft",
      agent: "Michael Brown",
      daysOnMarket: 2,
      priceChange: "+1.0%"
    },
    {
      id: 4,
      title: "Family House",
      location: "101 Suburbs St",
      price: "$1,800/month",
      image: "/api/placeholder/400/300",
      badge: "For Sale",
      beds: 3,
      baths: 2,
      area: "1800 sq ft",
      agent: "Emily Davis",
      daysOnMarket: 8,
      priceChange: "-0.5%"
    }
  ];

  // Handle navigation
  const goToPrevious = () => {
    const isFirstSlide = currentIndex === 0;
    const newIndex = isFirstSlide ? properties.length - 1 : currentIndex - 1;
    setCurrentIndex(newIndex);
  };

  const goToNext = () => {
    const isLastSlide = currentIndex === properties.length;
    const newIndex = isLastSlide ? 0 : currentIndex + 1;
    setCurrentIndex(newIndex);
  };

  // Effect to smoothly scroll to the current slide
  useEffect(() => {
    if (sliderRef.current) {
      const scrollAmount = currentIndex * (sliderRef.current.offsetWidth / 2);
      sliderRef.current.scrollTo({
        left: scrollAmount,
        behavior: 'smooth'
      });
    }
  }, [currentIndex]);

  return (
    <div className="property-listings">
      <div className="listings-header">
        <h2 className="listings-title">Featured Properties</h2>
        <p className="listings-subtitle">
          Explore our handpicked selection of premium properties available for sale and rent.
        </p>
      </div>

      {/* Property Slider */}
      <div className="relative">
        {/* Left Arrow */}
        <div 
          className="absolute left-2 top-1/2 transform -translate-y-1/2 bg-white/70 rounded-full p-2 cursor-pointer z-10 shadow-md hover:bg-white transition-colors"
          onClick={goToPrevious}
          style={{
            background: 'var(--background)',
            boxShadow: 'var(--shadow-md)',
            zIndex: 10,
            cursor: 'pointer',
            borderRadius: '50%',
            padding: '0.75rem',
            transition: 'var(--transition-medium)'
          }}
        >
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
          </svg>
        </div>

        {/* Right Arrow */}
        <div 
          className="absolute right-2 top-1/2 transform -translate-y-1/2 bg-white/70 rounded-full p-2 cursor-pointer z-10 shadow-md hover:bg-white transition-colors"
          onClick={goToNext}
          style={{
            background: 'var(--background)',
            boxShadow: 'var(--shadow-md)',
            zIndex: 10,
            cursor: 'pointer',
            borderRadius: '50%',
            padding: '0.75rem',
            transition: 'var(--transition-medium)'
          }}
        >
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
          </svg>
        </div>

        {/* Slider container */}
        <div 
          ref={sliderRef}
          style={{ 
            display: 'flex', 
            overflowX: 'auto',
            scrollbarWidth: 'none',
            msOverflowStyle: 'none',
            scrollSnapType: 'x mandatory'
          }}
        >
          {properties.map((property) => (
            <div 
              key={property.id}
              style={{ 
                flexShrink: 0, 
                width: '50%', 
                padding: '1rem',
                scrollSnapAlign: 'start'
              }}
            >
              <div className="property-card">
                <div className="property-badge">{property.badge}</div>
                <img 
                  src={property.image} 
                  alt={property.title} 
                  className="property-image"
                />
                <div className="property-details">
                  <h3 className="property-price">{property.price}</h3>
                  <div className="property-address">
                    <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
                    </svg>
                    {property.location}
                  </div>
                  <div className="property-meta">
                    <span>
                      <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 12h14M5 12a2 2 0 01-2-2V6a2 2 0 012-2h14a2 2 0 012 2v4a2 2 0 01-2 2M5 12a2 2 0 00-2 2v4a2 2 0 002 2h14a2 2 0 002-2v-4a2 2 0 00-2-2m-2-4h.01M17 16h.01" />
                      </svg>
                      {property.beds} Beds
                    </span>
                    <span>
                      <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" />
                      </svg>
                      {property.baths} Baths
                    </span>
                    <span>
                      <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5v-4m0 0h-4m4 0l-5 5" />
                      </svg>
                      {property.area}
                    </span>
                  </div>
                  <span className={`price-change ${property.priceChange.startsWith('+') ? 'up' : ''}`}>
                    <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d={property.priceChange.startsWith('+') ? "M13 7h8m0 0v8m0-8l-8 8-4-4-6 6" : "M13 17h8m0 0V9m0 8l-8-8-4 4-6-6"} />
                    </svg>
                    {property.priceChange} last month
                  </span>
                  <span className="days-on-market">{property.daysOnMarket} days on market</span>
                  <div className="property-agent">Listed by: {property.agent}</div>
                </div>
              </div>
            </div>
          ))}

          {/* View More Button as the last slide */}
          <div 
            style={{ 
              flexShrink: 0, 
              width: '50%', 
              padding: '1rem',
              scrollSnapAlign: 'start', 
              display: 'flex', 
              alignItems: 'center', 
              justifyContent: 'center' 
            }}
          >
            <button 
              style={{
                background: 'linear-gradient(135deg, var(--primary) 0%, var(--secondary) 100%)',
                color: 'white',
                padding: '1rem 2rem',
                borderRadius: 'var(--border-radius)',
                fontWeight: '600',
                boxShadow: 'var(--shadow-md)',
                transition: 'var(--transition-medium)'
              }}
              onClick={() => console.log("View More clicked")}
            >
              View More Properties
            </button>
          </div>
        </div>

        {/* Pagination dots */}
        <div style={{ display: 'flex', justifyContent: 'center', marginTop: '1.5rem', gap: '0.5rem' }}>
          {properties.map((_, index) => (
            <div
              key={index}
              style={{
                width: '0.75rem',
                height: '0.75rem',
                borderRadius: '50%',
                background: currentIndex === index ? 'var(--primary)' : 'rgba(0, 0, 0, 0.2)',
                transition: 'var(--transition-medium)'
              }}
            />
          ))}
          {/* Extra dot for the View More button */}
          <div
            style={{
              width: '0.75rem',
              height: '0.75rem',
              borderRadius: '50%',
              background: currentIndex === properties.length ? 'var(--primary)' : 'rgba(0, 0, 0, 0.2)',
              transition: 'var(--transition-medium)'
            }}
          />
        </div>
      </div>

      {/* Regular grid display of properties can still be included below */}
      <h3 style={{ fontSize: '1.5rem', fontWeight: '600', margin: '3rem 0 1.5rem' }}>All Properties</h3>
      <div className="properties-grid">
        {properties.map((property) => (
          <div key={property.id} className="property-card">
            <div className="property-badge">{property.badge}</div>
            <img 
              src={property.image} 
              alt={property.title} 
              className="property-image"
            />
            <div className="property-details">
              <h3 className="property-price">{property.price}</h3>
              <div className="property-address">
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
                </svg>
                {property.location}
              </div>
              <div className="property-meta">
                <span>
                  <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 12h14M5 12a2 2 0 01-2-2V6a2 2 0 012-2h14a2 2 0 012 2v4a2 2 0 01-2 2M5 12a2 2 0 00-2 2v4a2 2 0 002 2h14a2 2 0 002-2v-4a2 2 0 00-2-2m-2-4h.01M17 16h.01" />
                  </svg>
                  {property.beds} Beds
                </span>
                <span>
                  <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" />
                  </svg>
                  {property.baths} Baths
                </span>
                <span>
                  <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5v-4m0 0h-4m4 0l-5 5" />
                  </svg>
                  {property.area}
                </span>
              </div>
              <span className={`price-change ${property.priceChange.startsWith('+') ? 'up' : ''}`}>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d={property.priceChange.startsWith('+') ? "M13 7h8m0 0v8m0-8l-8 8-4-4-6 6" : "M13 17h8m0 0V9m0 8l-8-8-4 4-6-6"} />
                </svg>
                {property.priceChange} last month
              </span>
              <span className="days-on-market">{property.daysOnMarket} days on market</span>
              <div className="property-agent">Listed by: {property.agent}</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertyListings;
